import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and click the first "Add to Cart" button
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.click('.add-to-cart:first-of-type');

    // Wait for cart to update and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add.png'));

    // Extract product information
    const productTitle = await page.$eval('.product-title:first-of-type', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-price:first-of-type', el => el.textContent.trim());

    return {
      success: true,
      action: "Added first product to cart",
      extractedData: {
        productTitle,
        productPrice
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to add first product to cart",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
